import React from 'react'
import Layout from '../../Components/Layout';
import {Row,Col} from 'react-bootstrap';

export default function index() {
  
  return (
    <div>
      <Layout>
        <Container>
        <Row>
          <Col md={2}>Side bar</Col>
          <Col md={10}>Container</Col>
        </Row>
        </Container>
       
       {/*<h1>Welcome to Admin Dashboard</h1>*/}
      </Layout>
    </div>
  )
}
